import React from "react";
import "./CodeReview.css";

function Review() {
  return (
    <div className="w-[100%] h-[100vh]">
      <div className="left relative flex flex-col bg-black rounded-md ">
        <div className="code">Hello</div>
        <div className="review absolute b-[1rem] right-[1rem] text-white bg-red-700 p-2 rounded-sm">
          Review
        </div>
      </div>
      <div className="right w-1/2 flex flex-col gap-10 bg-[#343434] rounded-md"></div>
    </div>
  );
}

export default Review;
